      "richdescription_text": "Please purchase tickets at the link: [color=rgb(17, 85, 204)][url=https://www.eventbrite.com/e/ncp-the-crow-tickets-591925223277]https://www.eventbrite.com/e/ncp-the-crow-tickets-591925223277[/url][/color]\n\n[b][color=rgb(34, 34, 34)]NAKED COMEDY PRESENTS[/color][/b]\n[b][color=rgb(34, 34, 34)]IS BACK FOR VOL2: THE SANTA MONICA RESIDENCY [/color][/b]\n\nW﻿hat is \"Naked Comedy Presents?\"\n\nNaked Comedy has been producing live comedy for over 12 years, including 2 years of live streaming shows on Instagram, Youtube and more. Naked Comedy presents a new kind of comedy show, combining live comedy of all genres, both live streaming and in person, for a totally unique hour of programming.\n\nEvery show will feature a new host, new guests, and a new world that the show is built within. From longform character experiments to never before seen plays to exclusive debut pilot readings and more, each Naked Comedy Presents will be a new experience for audiences and performers alike.\n\nBe part of the grand experiment via our residency at The Nest at The Crow in beautiful Santa Monica, California. Plenty of parking and part of a major transit destination, the only thing to worry about is getting a ticket because SEATING WILL BE LIMITED.\n\nW﻿e will also be live streaming these shows for anyone who can't make it in person!\n\nWednesday July 19 - Hayden Johnson\nWednesday July 26 - Molly Renze\n\nTICKETS/MORE INFO ON INDIVIDUAL SHOWS:\n[color=rgb(17, 85, 204)][url=https://www.eventbrite.com/e/ncp-the-crow-tickets-591925223277]https://www.eventbrite.com/e/ncp-the-crow-tickets-591925223277[/url][/color]\n\nA﻿ll shows are 18+ and will be live streamed from The Crow.\nP﻿roof of Vax or same day negative test required.\nMasking encouraged (the room is small)\nP﻿lease note, the room is only accessible by stairs.\nN﻿on-Alcoholic drinks and snacks will be available for donation.",
