      "description_text": "Star Baker Comedy Show is a competition standup show with good vibes baked in. LA’s hottest comics bring both their best material AND some freshly baked jokes, then two judges pick their favorite set of the night and name that comic Star Baker! Creator and host Kelly Shanley bakes a cake for the winner - and cupcakes for the entire audience! \nStar Baker is a highly curated show that aims to uphold the charm of the Great British Baking Show because, according to Kelly, it's like a good slice of cake: light, sweet, and helped her cry a little bit less during lockdown. That's exactly what Kelly hopes to do for her audience with her live version of Star Baker; provide a dash of levity - and treats! - in a world that can be a bit bleak. ",
