      "richdescription_text": "[color=rgb(34, 34, 34)]Join us for an evening combining the piano bar format with comedy (with talented musician Elizabeth Setzer as well as hilarious comics like [/color][color=rgb(17, 85, 204)][url=https://www.estebangast.com/]Esteban Gast[/url][/color][color=rgb(34, 34, 34)]). All proceeds will go to the groundbreaking [/color][color=rgb(17, 85, 204)][url=https://cangress.org/services/ecohood/] EcoHoods Project[/url][/color][color=rgb(34, 34, 34)] to help create a prototype of permanent community housing in South Central Los Angeles. EcoHoods is a grassroots approach developed by the [/color][color=rgb(17, 85, 204)][url=https://cangress.org/]Los Angeles Community Action Network (LACAN)[/url][/color][color=rgb(34, 34, 34)] for sustainable, long-term housing for unhoused neighbors. It offers a tangible solution for one of the most pressing issues facing L.A. right now. And you can be a part of it! Just come on over, have a good time, let loose and laugh with us. [/color]",
