      "description_text": "Born & raised in LA, Sammy Weiser is as hilarious (and high) as it gets. From improv at The Groundlings, to sketch comedy at Upright Citizens Brigade, to her main focus, standup- she’s truly done it all. You’ve seen her perform all over LA (regularly closing out shows in the Belly room of The Comedy Store, Hollywood Improv, Ice House). She’s been described as “a bit much” and actually has a BFA in comedy from Emerson College, so she’s certifiably funny. Sammy currently works for Seth Rogen and Evan Goldberg on their upcoming series Sausage Party TV. \n\nTHE SWEISER SHOW is a monthly female run show brought to you by Sammy Weiser that is dedicated to bringing you a hilarious & diverse lineup of both newer and more established comedians. We want to curate an incredible combo of different types of comedic viewpoints to create a chill, fun, friendly night of endless laughs! Plus cute free merch with every ticket purchase.",
