      "description_text": "Storyectomy*\nReal, Raw & Revolutionary Storytelling Classes\nfor cancer survivors, thrivers, & caregivers\n*Get your story out\n\nWatch the students of the Storyectomy program and professional storytellers/comedians share their stories. Ticket proceeds will benefit the American Cancer Society.\n\n\n*Students can be anyone over 18 years old who is a cancer survivor, thriver (currently going through treatment), caregiver, family member, or medical professional who works with cancer patients.\n\n--\nStoryectomy is a community-driven mental health initiative using the art of storytelling and dark comedy to bring light, love, and healing to those affected by cancer. \nHeal with us. Healing comes from release. The Crow is partnering with The American Cancer Society on an innovative and supportive STORYTELLING project to give cancer survivors, thrivers, healthcare professionals and caregivers the space to share and connect. \n\nSponsored and supported by the generosity of RadNet, the nation’s leading radiology firm, we will offer FREE storytelling classes culminating in a final showcase for those whose lives are affected by cancer and want a healing space to share their real, raw, and relatable personal stories that will unite us in the fight against cancer.\n﻿\nMeeting at The Crow in Santa Monica on Thursdays for six weeks will provide students with the structure and guidance to tell their stories in a personal and effective way through Nicole Blaine’s teachings as a comedic storyteller. The final storytelling show features students alongside professional comedians that have also been affected by cancer. As the program expands, we will have our performers share their stories at walks, fundraisers, and beyond. ",
