      "richdescription_text": "[b][size=6][highlight=transparent]Storyectomy*[/highlight][/size][/b]\n[highlight=transparent]Real, Raw & Revolutionary Storytelling Classes[/highlight]\n[highlight=transparent]for cancer survivors, thrivers, & caregivers[/highlight]\n[i][highlight=transparent]*Get your story out[/highlight][/i]\n\nWatch the students of the Storyectomy program and professional storytellers/comedians share their stories. Ticket proceeds will benefit the [url=https://www.cancer.org/]American Cancer Society[/url].\n\n\n[b][highlight=transparent]*Students can be anyone over 18 years old who is a cancer survivor, thriver (currently going through treatment), caregiver, family member, or medical professional who works with cancer patients.[/highlight][/b]\n\n[highlight=transparent]--[/highlight]\n[i][highlight=transparent]Storyectomy is a community-driven mental health initiative using the art of storytelling and dark comedy to bring light, love, and healing to those affected by cancer. [/highlight][/i]\n[i][highlight=transparent]Heal with us.[/highlight][/i][highlight=transparent] Healing comes from release. The Crow is partnering with The American Cancer Society on an innovative and supportive STORYTELLING project to give cancer survivors, thrivers, healthcare professionals and caregivers the space to share and connect. [/highlight]\n\n[highlight=transparent]Sponsored and supported by the generosity of[/highlight][highlight=transparent][url=https://www.radnet.com/] RadNet[/url][/highlight][highlight=transparent], the nation’s leading radiology firm, we will offer [/highlight][b][highlight=transparent]FREE [/highlight][/b][highlight=transparent]storytelling classes culminating in a final showcase for those whose lives are affected by cancer and want a healing space to share their real, raw, and relatable personal stories that will unite us in the fight against cancer.[/highlight]\n[highlight=transparent]﻿[/highlight]\n[highlight=transparent]Meeting at The Crow in Santa Monica on Thursdays for six weeks will provide students with the structure and guidance to tell their stories in a personal and effective way through Nicole Blaine’s teachings as a comedic storyteller. The final storytelling show features students alongside professional comedians that have also been affected by cancer. As the program expands, we will have our performers share their stories at walks, fundraisers, and beyond. [/highlight]",
