      "richdescription_text": "Get ready to laugh and learn some sh*t when these stand up comics of different races and cultures sound off on the stupidest, most evil man-made invention ever: racism. Followed by a roundtable, the comics dig into the issues behind their jokes, riff on each other's sets, and create world peace. It ain't over till the white lady asks for the manager!\n\nHOST & PRODUCER of Wake Up Becky: Emily James has performed stand up all over the US and most frequently on LA stages: The Comedy Store, Flappers, The Hollywood Improv and more. She has toured the college scene and performed for sold out shows with her passion project \"Wake Up, Becky.\" Her stand up special entitled Late to the Party with Emily James which crassly focuses on her life as a sexually charged wife and mother of 2 small boys who was diagnosed with Multiple Sclerosis during the pandemic. \n\nPlease Note: \nTHIS SHOW WAKE UP BECKY AND HEAL OUR NATION IS BEING FILMED AND/OR VIDEOTAPED FOR FUTURE TELECASTS AND/OR OTHER EXPLOITATIONS AT THE PRODUCER’S DISCRETION AND MAY INCLUDE PICTURES OF THE AUDIENCE OR INDIVIDUALS IN THE AUDIENCE. ATTENDANCE AT THIS EVENT SHALL BE DEEMED YOUR CONSENT TO APPEAR IN SUCH TELECASTS, OTHER EXPLOITATIONS AND ANY ADVERTISING AND PROMOTION THEREOF, WITHOUT COMPENSATION.\n",
