      "description_text": "Catch Tomorrow's Ladies of Late Night!!\nBrought to you by The Crow and LOCA (Ladies of Comedy Association)\n\n8:00pm: Our top 10 comics perform their best 5 minute sets!\n\nTickets: \nIndustry Comps and Industry Donations available. \n\nOur goal is to make it easier for industry execs to discover women-identifying and non-binary stand-up comics to help create connections and opportunities for more growth and career advancement.  Thank you for sharing this common goal! \n\nThe Crow (owned and operated by Nicole Blaine) and LOCA (Ladies of Comedy Association) have partnered to create Tomorrow’s Ladies of Late Night - a curated quarterly lineup of fresh, top-shelf talent to showcase for industry executives. After monthly audition mics, we have selected the best TV-ready comics to perform for bookers, agents, managers, and industry executives. \nThe first Industry Showcase in July 2023 was incredible, and we invite you to enjoy our second Industry Showcase of 2023 on: \nMonday, November 13, 2023 at 8pm at The Crow.\n\nEnjoy FREE PARKING in our lot at Bergamot Station Arts Center!\n\nFor our industry audience, this is a \"Pay What You Can\" event. We want everyone to be able to attend regardless of price. \nYou are welcome to have a comp ticket or we kindly accept a donation of $20 that will go directly to The Crow's 501c3 for more community programming like this, along with comedy classes for kids, teens and adults. Thank you for growing with us!\n",
