      "richdescription_text": "[b][size=4]Catch Tomorrow's Ladies of Late Night!![/size][/b]\n[i]Brought to you by The Crow and LOCA (Ladies of Comedy Association)[/i]\n\n[b]8:00pm:[/b] Our top 10 comics perform their best 5 minute sets!\n\nTickets: \n[b]Industry Comps[/b] and [b]Industry Donations[/b] available. \n\n[b]Our goal is to make it easier for industry execs to discover women-identifying and non-binary stand-up comics to help create connections and opportunities for more growth and career advancement. [/b][color=rgb(220, 93, 60)] Thank you for sharing this common goal! [/color]\n\n[color=rgb(0, 102, 204)][url=https://crowcomedy.com/]The Crow (owned and operated by Nicole Blaine)[/url][/color] and [color=rgb(0, 102, 204)][url=https://www.theladiesofcomedy.com/#:~:text=DEDICATED%20TO%20ADVANCING%20THE%20CAREERS,careers%20of%20women%20in%20comedy.]LOCA (Ladies of Comedy Association)[/url][/color] have partnered to create [color=rgb(0, 102, 204)][url=https://crowcomedy.com/tomorrows-ladies-of-late-night]Tomorrow’s Ladies of Late Night[/url][/color][color=rgb(0, 102, 204)] [/color]- a curated quarterly lineup of fresh, top-shelf talent to showcase for industry executives. After monthly audition mics, we have selected the best TV-ready comics to perform for bookers, agents, managers, and industry executives. \nThe first Industry Showcase in July 2023 was incredible, and we invite you to enjoy our second Industry Showcase of 2023 on: \n[b][color=rgb(220, 93, 60)]Monday, November 13, 2023 at 8pm at The Crow.[/color][/b]\n\nEnjoy [b]FREE PARKING[/b] in our lot at [color=rgb(0, 102, 204)][url=https://crowcomedy.com/directions]Bergamot Station Arts Center[/url][/color]!\n\nFor our industry audience, this is a \"Pay What You Can\" event. We want everyone to be able to attend regardless of price. \nYou are welcome to have a comp ticket or we kindly accept a donation of $20 that will go directly to The Crow's 501c3 for more community programming like this, along with comedy classes for kids, teens and adults. Thank you for growing with us!\n",
