      "richdescription_text": "[url=https://www.donttellmymother.com/]Don't Tell My Mother[/url] with Nikki Levy is where your favorite queers (and allies!) tell true stories they'd NEVER want their moms to know. Join us Thursday, November 30 for a raucous night featuring JOHNNY SIBILLY (Hacks), JESSE JAMES KEITEL (Star Trek: Strange New Worlds), RACHEL SCANLON (Two Dykes & a Mic), E.R. FIGHTMASTER (Grey's Anatomy) and hosted by NIKKI LEVY. Music by ABBY POSNER.\n\nFor more info: [url=https://www.donttellmymother.com/]DontTellMyMother.com[/url]\n",
