      "richdescription_text": "[color=rgb(34, 34, 34)]Join us for an inclusive night of comedy to raise money in expanding access to the performing arts for neurodiverse artists in Los Angeles.[/color]\n\nEPIC Players (Empower, Perform, Include, Create), founded in Brooklyn, NY on August 25, 2016, is a 501c3 nonprofit, neuro-diverse theatre company that provides access, education, opportunity and community to neuro-diverse artists living with autism and other developmental disabilities. Through our mainstage season, cabarets, devised works, and educational roster, we seek to increase social and workplace opportunities in the arts for our members and to break down negative stereotypes surrounding neuro-diverse communities.\n\nAnd now...Hollywood's Calling!\n\nEPIC has begun the process of growing in Los Angeles, where we hope to continue being a force in creating more professional and accessible opportunities for actors with disabilities. EPIC is proud to have brokered opportunities in film and television for EPIC NYC members since our inception, including in the film \"Good Time\" and shows like \"See\" and \"Blue Bloods,\" as well as numerous other audition opportunities (Disney, Netflix, etc.). We aim to exponentially increase these opportunities by establishing ourselves in the world's film and TV capital.",
