      "description_text": "Join us for a night of the best Jewish comedians from HBO, Comedy Central, and Netflix. 50% of the proceeds from the comedy show will benefit SOVA (part of JFSLA).\n \nWe’ve also partnered with our neighbors at Birdie G’s on this two-day fundraiser, as part of 8 Nights at Birdie G’s, a Hanukkah-ish dinner series presented by Resy. Each night, Chef/Owner Jeremy invites notable chefs from across the country to cook à la carte specials at this restaurant. For those enjoying an early dinner on December 5 and 7, as well as attending our comedy show, Birdie G’s will donate 10% of your dinner check to SOVA. When making a dinner reservation or if you’ve already made one, open the Resy app and add “I’m going to The Crow after!” in the “Any Special Requests” section. This will ensure the Birdie G’s team makes a donation on your behalf.\n\n﻿Please reach out to jamie@crowcomedy.com\nfor questions or group rates.",
