      "richdescription_text": "[color=rgb(35, 35, 37)]Join us for a night of the best Jewish comedians from HBO, Comedy Central, and Netflix. 50% of the proceeds from the comedy show will benefit SOVA ([/color][color=rgb(17, 85, 204)][url=https://www.jfsla.org/]part of JFSLA[/url][/color][color=rgb(35, 35, 37)]).[/color]\n \nWe’ve also partnered with our neighbors [color=rgb(42, 42, 42)]at [/color][color=rgb(17, 85, 204)][url=https://resy.com/cities/la/birdiegs][b]Birdie G’s[/b][/url][/color][color=rgb(42, 42, 42)] on this two-day fundraiser, as part of [/color][color=rgb(17, 85, 204)][url=https://blog.resy.com/2023/10/8-nights-at-birdie-gs/]8 Nights at Birdie G’s[/url][/color][color=rgb(42, 42, 42)], a Hanukkah-ish dinner series presented by Resy. Each night, Chef/Owner Jeremy invites notable chefs from across the country to cook à la carte specials at this restaurant. For those enjoying an early dinner on December 5 and 7, as well as attending our comedy show, Birdie G’s will donate 10% of your dinner check to SOVA. [/color][i]When making a dinner reservation or if you’ve already made one, open the [/i][color=black][url=https://blog.resy.com/2023/10/8-nights-at-birdie-gs/][i]Resy app[/i][/url][/color][i] and add “I’m going to The Crow after!” in the “Any Special Requests” section. This will ensure the Birdie G’s team makes a donation on your behalf.[/i]\n\n﻿Please reach out to jamie@crowcomedy.com\nfor questions or group rates.",
