      "richdescription_text": "[b][color=rgb(35, 35, 37)]Join in on the fun whether you've taken a previous class or not! The Crow is combining the basics of a Stand Up 101 Class with the Next Level Lessons of a 201 Class for this unique opportunity for anyone interested in learning the art of comedy! [/color][/b]\n\n[color=rgb(35, 35, 37)]The Crow offers high school teens the opportunity to learn professional stand-up comedy by developing their personal comedic voice and point of view! This course helps young adults learn joke structure, technique, and comedy writing formulas while creating their own material. Students will learn the concepts of building a story, premise, and punch line all while gaining confidence in public speaking and communication. We work on stage presence, finding courage to keep going when the going gets rough, thinking on your feet, and finding the funny structurally! This 6 week course meets once a week for 2.5 hours, culminating in a public stand-up/storytelling show at The Crow’s main stage.[/color]\n\nTeen 101/201: 6 Saturdays from 2:00pm - 4:30pm\nSaturday, January 13\nSaturday, January 20\nSaturday, January 27 \nSaturday, February 3\nSaturday, February 10 \nSaturday, February 17\nShowcase: Friday, February 23 at 6pm before the IRL Comedy Show\n\nAge requirement: You must be in high school to participate. \n[b][color=rgb(35, 35, 37)]No prior experience needed! Come ready with a pencil and writing pad! [/color][/b]\n",
