      "richdescription_text": "Get ready for the hottest comedy showcase in Santa Monica & beyond! The stage is set for the best emerging stand-up comedians from the vibrant comedy scene of Southern California. These talented individuals are gearing up to tickle your funny bone and, more importantly, catapult their careers to new heights.\n\nFounded in 2010 by none other than Kenan Thompson**, the legendary Saturday Night Live (SNL) cast member, and his esteemed business partner Cherie Chiles-Buchanan, the #KenanPresents Live Comedy Showcase has become synonymous with discovering the next big names in comedy. \n\nIn an unprecedented move, #KenanPresents is thrilled to announce that, from January to May 2024, Kenan Thompson will be inviting several comedians to SNL as his special guests every month! This is a historic moment, and we believe it will unlock boundless opportunities for everyone involved.\n\nMark your calendars for The Crow on Saturday, January 13, where the invited VIP guests and the audience will have the power to influence the trajectory of these comedians' careers. Be part of the decision-making process as we identify the premier performers who will progress to national stages and ultimately the Grand Finale showcase in the comedy capital, New York City, in May 2024.\n\nBe a part of history and help shape the future of comedy by attending Kenan Presents VIP Access Comedy. It's not just a comedy show; it's an experience that could change lives.\n\n**Kenan Thompson will not be in attendance or performing.\n",
