      "richdescription_text": "[i]An open mic for female and nonbinary comics at LA's newest comedy club, The Crow! Open to the public to participate or watch. [/i]\n[i]Hosted by Olivia Hill [/i]\n\n[b]Time and Day:[/b] Every Tuesday. [b]NEW TIME:[/b] Doors open at 5:15 PM. The mic starts at 5:30 PM.\n\n[b]TO SIGN UP: [/b]\nThe Slotted Link will open for Sign Ups at 3 PM every Thursday. Sign Up HERE: [url=https://slotted.co/boysdroolmic/]https://slotted.co/boysdroolmic/[/url]\nYou must pay by midnight on the day you sign up to keep your spot! \n[b]Cost:[/b] $5 for 5 minutes. Please pay through venmo @crowcomedy\n\nComing to watch and support is [b]FREE! [/b]\nPlease stay for the whole hour! ",
