      "description_text": "For students who have already taken The Crow's Stand-Up 101, this class will help you to further define and cultivate your personal comedic voice and point of view! This advanced course builds on the work you've done in Stand-Up 101 and explores other, more nuanced aspects of stand-up, joke structure, and deeper storytelling. The class is structured like a writer's room experience and leans into collaboration and a supportive team spirit. This 6 week course meets once a week for 3 hours, culminating in a public stand-up/storytelling show on The Crow’s main stage.\n\nThere are two options for students. \n\nOption 1:\nYou can sign up for all 6 classes that meet once a week for 3 hours, plus perform in the final showcase. Cost is $375\n\nOption 2:\nYou can sign up for 4 out of the 6 classes and drop in to any 4 you'd like to attend. Plus you will perform in the final showcase. Cost is $275\n\nWINTER SESSION STARTS 1/31/24\nConsecutive Wednesdays 7:00pm - 10:00pm\nDates:\nJan 31, Feb 7, Feb 14, Feb 21, Feb 28, Mar 6\nFinal Show Saturday, March 9, 2024 at 6 PM \n",
