      "richdescription_text": "Have a baby? Date nights non-existent? \n\nWe have an adult comedy show for parents that you can bring your baby to! \n\nThe BYOB Comedy Show: bring your baby, boob, bottle, buggy! (Stroller parking included.)\n\nEnjoy a dirty** comedy show in the middle of the day instead of crying in the corner while your baby doesn't nap.\n\nBring the baby to the show because they don't understand sh*t yet!\n\n[color=rgb(111, 114, 122)]**includes jokes and diapers[/color]\n\n[highlight=transparent]A note from the owner of The Crow: [/highlight]\n[highlight=transparent]BYOB was birthed, pun intended, from my own PTSD from having a colicky baby. I had a really tough time getting through those first 18 months of parenthood and finding a new community of parents that were willing to acknowledge how tough this time was. Now, a survivor of parenting teenagers (who still seem to suffer from colic) I own a comedy club that has programming that specifically uses comedy as a way to cure the baby blues.[/highlight]\n",
