      "richdescription_text": " A salacious science comedy show about the science of sex!\n\n\"Survival of the Filthiest\" is a science comedy show that covers the bawdy biology your high school didn’t to teach you- from the evolution of boning, to why women have boobs, to the backstory of butts, to the queerest gaynimals out there, to the 'unhung hero' of genitalia- the clitoris, to what humans can learn from our closest genetic relatives- the bonobos. Biological anthropologist and comedian Natalia Reagan will take you on a hilarious journey that’s equal parts comedy show and sexy science class.\n\n[b]Natalia Reagan[/b] is an anthropologist, primatologist, comedian, host, producer, podcaster, professor, writer, frequent animal expert, and monkey chasing weirdo. Before becoming a scientist, she was a comedic actress, getting her SAG card whilst playing a dancing Chicken McNugget in a McDonald’s commercial. Natalia landed bit parts in [i]The Drew Carey Show[/i], [i]Everybody Loves Raymond[/i], [i]My Name is Earl[/i], and [i]Sex Drive[/i]. After getting hit by her own truck on the shoulder of the 101 freeway, Natalia decided to go back to school to become a biological anthropologist. For her master’s fieldwork, she conducted a survey of the Azuero spider monkey in rural Panama. After grad school, Natalia began producing science comedy videos in her garage covering such titillating topics as the evolution of boobs, butts, balls, and Bigfoot. “The Story of Boobs: The Breast Tale Ever Told” landed her on the TODAY show to talk tatas with Ann Curry. After admitting on national television that she watched Skinimax films as a child, the TODAY Show has not asked her back. In 2013, Natalia co-hosted SpikeTV's “10 Million Dollar Bigfoot Bounty” (spoiler alert: No one found the big guy). This led to expert roles on Discovery and Nat Geo Wild and, in 2017, Natalia moved to NYC to be comedy writer, correspondent, & host for Neil deGrasse Tyson’s StarTalkTV and All-Star podcast. She’s also been a science and animal expert on Nat Geo, History, Travel, Thrillist, Seeker, Fox, and now she is a regular podcaster for Scientific American’s [i]Science Quickly[/i]. She has also published chapters in the Wiley Encyclopedia of Primatology (including “The Copulatory Postures of Nonhuman Primates”- AKA monkey sex positions), [i]ACS’s Hollywood Chemistry[/i], [i]Congreso de Antropología Panameña, [/i]and the upcoming Nerd Nite book. Natalia currently lives in her hometown of LA and produces science comedy content for herself and others while her hyper-critical pug, Raisin, quietly judges from her throne of lies (the couch).",
